package LeetCode;

import java.util.HashMap;

public class Anagram {
    public static boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) return false;
        char[] arrS = s.toCharArray();
        char[] arrT = t.toCharArray();
        HashMap<Character, Integer> mapOfS = new HashMap<>();
        HashMap<Character, Integer> mapOfT = new HashMap<>();
        for (int i = 0; i < arrS.length; i++) {
            if (mapOfS.containsKey(arrS[i]))
                mapOfS.replace(arrS[i], mapOfS.get(arrS[i]) + 1);
            else
                mapOfS.put(arrS[i], 1);
        }

        for (int i = 0; i < arrT.length; i++) {
            if (mapOfT.containsKey(arrT[i]))
                mapOfT.replace(arrT[i], mapOfT.get(arrT[i]) + 1);
            else
                mapOfT.put(arrT[i], 1);
        }

        for (int i = 0; i < arrT.length; i++) {
            if (mapOfS.containsKey(arrT[i]) && (mapOfS.get(arrT[i]).equals(mapOfT.get(arrT[i])))) {continue;}
            else {return false;}
        }
        return true;
    }
    public static void main(String[] args) {
    String s = "";
    String t = "";
    String a = "aacc";
    String b = "ccac";
    System.out.println(Anagram.isAnagram(s,t));
    }
}
